#nullable enable // autogenerated

using System.Collections.Generic;
using System.Xml;

namespace MVZ2.Metas
{
    public class NoteMetaList
    {
        public NoteMeta[] metas;

        public NoteMetaList(NoteMeta[] metas)
        {
            this.metas = metas;
        }

        public static NoteMetaList FromXmlNode(XmlNode node, string defaultNsp)
        {
            var resources = new List<NoteMeta>();
            for (int i = 0; i < node.ChildNodes.Count; i++)
            {
                var meta = NoteMeta.FromXmlNode(node.ChildNodes[i], defaultNsp);
                if (meta != null)
                {
                    resources.Add(meta);
                }
            }
            return new NoteMetaList(resources.ToArray());
        }
    }
}
